import React from "react";
import "./row_list.css";
import row from '../Row/row';

// create 5 rows in a vertical fashion
const row_list = () => {
    return(
        <div style={row_list}>
            <row />
            <row />
            <row />
            <row />
            <row />
        </div>
    )
}

export default row_list;
